    t[432] = "There was {0} event in this period.";
    t[433] = new java.lang.String[] { "\u0417\u0430 \u044d\u0442\u043e\u0442 \u043f\u0435\u0440\u0438\u043e\u0434 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e {0} \u0441\u043e\u0431\u044b\u0442\u0438\u0435.", "\u0417\u0430 \u044d\u0442\u043e\u0442 \u043f\u0435\u0440\u0438\u043e\u0434 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e {0} \u0441\u043e\u0431\u044b\u0442\u0438\u044f.", "\u0417\u0430 \u044d\u0442\u043e\u0442 \u043f\u0435\u0440\u0438\u043e\u0434 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e {0} \u0441\u043e\u0431\u044b\u0442\u0438\u0439.", "\u0417\u0430 \u044d\u0442\u043e\u0442 \u043f\u0435\u0440\u0438\u043e\u0434 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e {0} \u0441\u043e\u0431\u044b\u0442\u0438\u0439." };
