    t[3596] = "KBps Out";
    t[3597] = "\u041a\u0438\u043b\u043e\u0431\u0430\u0439\u0442/\u0441\u0435\u043a\u0443\u043d\u0434\u0443 (\u043d\u0430 \u043e\u0442\u0434\u0430\u0447\u0443)";
