    t[5584] = "Prevents server discovery by floodfills";
    t[5585] = "\u0417\u0430\u043f\u0440\u0435\u0449\u0430\u0435\u0442 \u043e\u0431\u043d\u0430\u0440\u0443\u0436\u0435\u043d\u0438\u0435 \u0441\u0435\u0440\u0432\u0435\u0440\u043e\u0432 floodfill'\u0430\u043c\u0438.";
