    t[6571] = "\u0412\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u0435 UDP";
    t[6572] = "Usage";
    t[6573] = "\u0422\u0440\u0430\u0444\u0438\u043a";
    t[6574] = "Reachability change";
    t[6575] = "\u0418\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u0435 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u043e\u0441\u0442\u0438";
    t[6576] = "It will take some time for your peers to integrate your router into the network, but while that is happening you can still explore I2P applications and get to know your way around the router console.";
    t[6577] = "\u041f\u043e\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u0435 \u043a \u0443\u0437\u043b\u0430\u043c \u0438 \u0438\u043d\u0442\u0435\u0433\u0440\u0430\u0446\u0438\u044f \u0432\u0430\u0448\u0435\u0433\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 \u0432 \u0441\u0435\u0442\u044c I2P \u0437\u0430\u0439\u043c\u0451\u0442 \u043a\u0430\u043a\u043e\u0435-\u0442\u043e \u0432\u0440\u0435\u043c\u044f, \u043d\u043e \u0432\u044b \u043c\u043e\u0436\u0435\u0442\u0435 \u043e\u0442\u043a\u0440\u044b\u0432\u0430\u0442\u044c \u0440\u0430\u0437\u043b\u0438\u0447\u043d\u044b\u0435 \u043f\u0440\u0438\u043b\u043e\u0436\u0435\u043d\u0438\u044f \u0438 \u043e\u043f\u0446\u0438\u0438 \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u044d\u0442\u043e\u0433\u043e \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u0430, \u0447\u0442\u043e\u0431\u044b \u0431\u044b\u0441\u0442\u0440\u0435\u0435 \u043e\u0441\u0432\u043e\u0438\u0442\u044c\u0441\u044f \u0441 \u043a\u043e\u043d\u0441\u043e\u043b\u044c\u044e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430.";
    t[6578] = "Fast, High Capacity";
    t[6579] = "\u0411\u044b\u0441\u0442\u0440\u044b\u0435, \u0432\u044b\u0441\u043e\u043a\u043e\u0435\u043c\u043a\u0438\u0435";
    t[6582] = "This may range from under 100 to several thousand.";
    t[6583] = "\u042d\u0442\u043e \u043c\u043e\u0436\u0435\u0442 \u0432\u0430\u0440\u044c\u0438\u0440\u043e\u0432\u0430\u0442\u044c\u0441\u044f \u043e\u0442 100 \u0434\u043e \u043f\u0430\u0440\u044b \u0442\u044b\u0441\u044f\u0447.";
    t[6594] = "ANONYMITY WARNING - Settings include 1-hop tunnels.";
    t[6595] = "\u041e\u041f\u0410\u0421\u041d\u041e \u0414\u041b\u042f \u0410\u041d\u041e\u041d\u0418\u041c\u041d\u041e\u0421\u0422\u0418 \u2014 \u041d\u0430\u0441\u0442\u0440\u043e\u0439\u043a\u0438 \u0437\u0430\u0434\u0430\u044e\u0442 1-\u0445\u043e\u043f\u043e\u0432\u044b\u0435 \u0442\u0443\u043d\u043d\u0435\u043b\u0438.";
    t[6600] = "Updated router";
    t[6601] = "\u041c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u043e\u0431\u043d\u043e\u0432\u043b\u0451\u043d";
    t[6602] = "The maximum number of concurrent messages to send";
    t[6603] = "\u041c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u043e\u0435 \u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e \u043f\u0430\u0440\u0430\u043b\u043b\u0435\u043b\u044c\u043d\u043e \u043e\u0442\u043f\u0440\u0430\u0432\u043b\u044f\u0435\u043c\u044b\u0445 \u0441\u043e\u043e\u0431\u0449\u0435\u043d\u0438\u0439";
